import React from 'react';
import {url} from '../url';
import Axios from 'axios';



class AdminLogin extends React.Component{
    constructor(){
        super();
    }
    render(){
        return(
          <div style={{textAlign:"center"}}>
          <div class='form'>
          <form method="POST" action={`${url}/adminlogin`}>
          <label style={{fontSize: "2em"}}>REGISTER</label><br/><br/><br/>
          <img src="https://s3.amazonaws.com/thumbnails.illustrationsource.com/huge.102.513291.JPG" alt="" width="200px" height="200px"/><br/><br/>
          <label>Email</label><br/><br/>
          <input type="email" name="email" required/><br/><br/>
                  <label>Username</label><br/><br/>
          <input type="text" name="name" required /><br/><br/>
          <label>Password</label><br/><br/>
          <input type="password" name="password" required /><br/><br/>
                  <label>Confirm Password</label><br/><br/>
          <input type="password" name="cpassword" required /><br/><br/>
          <button style={{cursor: "pointer",fontSize: "1em"}}>Register</button><br/><br/>
          </form>
          </div>
        </div>
        )
    }
}
export default AdminLogin;
